{
"application": "GEOS-Chem",
"details": {
"script_details": {
"purpose": "Runs parallelization tests on various GEOS-Chem Classic run directories",
"arguments": {
"required": [
"-d root-dir: Root folder for integration tests",
"-t compile|all: Tests to run (compile-only or all)"
],
"optional": [
"-e env-file: Software environment file for Harvard Cannon",
"-h: Display help message",
"-n: Do not bootstrap missing restart file variables",
"-q: Run a quick set of integration tests (for testing)"
]
},
"environment_variables": [
"site: Name of the site (e.g. CANNON, COMPUTE1)",
"envFile: Path to the environment file",
"testsToRun: Type of tests to run (compile or all)",
"quick: Flag indicating quick tests (YES/NO)",
"ptRoot: Root directory for parallelization tests",
"logsDir: Directory for log files",
"scriptsDir: Directory for scripts",
"thisDir: Current directory"
]
},
"software_requirements": {
"scripts": [
"parallelTestCreate.sh",
"parallelTestCompile.sh",
"parallelTestExecute.sh",
"commonFunctionsForTests.sh"
],
"scheduler": {
"cannon": "SLURM",
"compute1": "LSF"
},
"libraries": [
"getopt",
"sed"
]
},
"resource_requirements": {
"memory": {
"compile": "8 GB",
"execute": "90 GB"
},
"cpu_cores": {
"compile": "8",
"execute": "24"
},
"time": {
"compile": "0:30",
"execute": "6:00"
},
"partition": "REQUESTED_PARTITION"
}
}
